<script>
    window.sentryOnLoad = function () {
        function convertToFloat(num) {
            return parseFloat((num / 100).toFixed(1));
        }
        const sampleRate = convertToFloat(
            window._flags['dashboard.monitoring.sentry.sampleRate'] || 0
        );
        const ignoreErrors = window._flags['dashboard.monitoring.sentry.ignoreErrors'] || [];
        Sentry.init({
            environment: window.envInfo?.environment,
            release: 'production_5678',
            initialScope: {
                tags: {
                    accountOwnerUuid: window._account?.accountOwnerUuid,
                    isCustomer: window._account?.isCustomer,
                    isInTrial: window._account?.isInTrial,
                    isProductOwner: window._account?.isProductOwner,
                    isStaffMember: window._account?.isStaffMember,
                    isWLReseller: window._account?.isWLReseller,
                    planType: window._account?.planType,
                    url: window.location.href,
                },
                user: { id: window._account?.uuid },
            },
            ignoreErrors,
            sampleRate,
            beforeSend(event) {
                if (
                    navigator.webdriver ||
                    window?.commonProps?.['server.for.resources']?.includes(
                        'localhost'
                    )
                ) {
                    return null;
                }
                if (
                    ignoreErrors.some((pattern) => {
                        const error = event.originalException;
                        return (
                            error?.message?.includes(pattern) ||
                            error?.name?.includes(pattern)
                        );
                    })
                ) {
                    return null;
                }
                return event;
            },
            beforeBreadcrumb: (breadcrumb, hint) => {
                if (
                    (breadcrumb.level === 'info' || breadcrumb.level === 'debug') &&
                    breadcrumb.category === 'console'
                ) {
                    return null;
                }
                if (['xhr', 'fetch'].includes(breadcrumb.category)) {
                    const xhrUrl = breadcrumb.data?.url || '';
                    if (
                        [
                            'google-analytics.com',
                            'fullstory.com',
                            'mixpanel.com',
                        ].some((pattern) => xhrUrl.includes(pattern))
                    ) {
                        return null;
                    }
                }
                return breadcrumb;
            },
        });
    };
</script>

                    $('.PreviewPaneInnerWrapper').css('visibility', 'visible');

                }
            }

            
            $('#inSiteSelect').ddslick({
                onSelected: function (obj) {
                    var ruleId = obj.selectedData.value;
                    selectInSite(ruleId);
                },
                background: 'var(--header-color)'
            });

        });

        //handle with main device
        function changeMainDevicetype(thisDevice) {
            var iFrame, visibleIframes;
            var forceDevice = "null";
            var PreviewPaneWrapper = $("#PreviewPaneWrapper");
            var PreviewPaneInnerWrapper = $(".PreviewPaneInnerWrapper");
            var previewWrapper = $("#previewWrapper");
            //remove active from all devices except sub-diveces because we want to keep the sub-device active state
            $(".devicesWrapper a:not(.sub-device)").removeClass("active");
            //remove rotate class if exist. we don't want to save the rotate state
            $(".rotate").removeClass("active");
            PreviewPaneWrapper.removeClass("rotate-device");

            //make choosen device active
            thisDevice.addClass("active");
            var device = thisDevice.data("device");

            $("#Wrapper").attr("data-device", device);
            iFrame = previewWrapper.find('iframe.' + device);
            visibleIframes = iFrame;
            if (thisDevice.is('[data-device="all"]')) {
                PreviewPaneWrapper.addClass("all").attr("device", "all");
                PreviewPaneInnerWrapper.addClass("active");
                visibleIframes = previewWrapper.find('iframe.' + device + ", iframe.all");
            } else {
                PreviewPaneWrapper.removeClass("all").attr("device", device);
                PreviewPaneWrapper.css({transform: ''});
                PreviewPaneInnerWrapper.removeClass("active");
                $(".PreviewPaneInnerWrapper[data-device='" + device + "']").addClass("active");
                iFrame.get(0).style.opacity = 1;
            }
            if (device === "desktop" || device === "all") {
                previewWrapper.css({ overflow: "hidden" });

            } else {
                previewWrapper.css({ overflow: "auto" });
            }

            $.each(visibleIframes, function (index, value) {
                var f = $(value);
                if (f.attr("src") == '') {
                    f.attr("src", f.attr("data-src"))
                    value.contentWindow.location.replace(f.attr("src"));
                }
            });

            handleDevicesSizes(device);

        }

        //handle with sub device
        function changeSubDeviceType(deviceCompany) {
            //if is rotate button
            if (deviceCompany.is(".rotate")) {
                $('#PreviewPaneWrapper').toggleClass('rotate-device');
                deviceCompany.toggleClass('active');
            } else {
                //change the device company
                var deviceType = deviceCompany.attr('data-deviceType');
                var allCompanies = $('.device-symbol');
                allCompanies.removeClass('active');
                $('#PreviewPaneWrapper').attr('device-type', deviceType);
                deviceCompany.addClass('active');
            }
        }

        $(window).resize(function () {
            if ($("#PreviewPaneWrapper").attr("device") === "all") {
                handleDevicesSizes($("#PreviewPaneWrapper").attr("device"));
            } else {
                handleDevicesSizes($("#PreviewPaneWrapper").attr("device"));
            }

        });

        function handleDevicesSizes(device) {
            if (device === "all") {
                $.previewfw.calcDevicesPositionAndScale(device, width, height);
            } else {
                $.previewfw.calcDevicesPositionAndScale(device);
            }
        }

    })(jQuery, this);

<script type="text/javascript">

function getURLParameter(sParam) {
  var sPageURL = window.location.search.substring(1);
  var sURLVariables = sPageURL.split('&');
  for (var i = 0; i < sURLVariables.length; i++) {
    var sParameterName = sURLVariables[i].split('=');
    if (sParameterName[0] == sParam) {
      return sParameterName[1];
    }
  }
};

var waitForEl = function(callback) {
  var magButton = $("div[data-auto='topBarButton magnifier']");
  if (magButton.length) {
    callback();
  } else {
    setTimeout(function() {
      waitForEl(callback);
    }, 500);
  }
};

function waitForMonacoBtn() {
  var monaco_url = getURLParameter('monaco_url');
  if (monaco_url) {
    waitForEl(function() {
      insertButton();
    });  
  }
}
  
function goToMonaco() {
  const link = document.createElement('a');
  link.href = getURLParameter('monaco_url');
  link.target = '_blank';
  link.rel = 'noopener';
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
}

function createButton() {
  var text = getURLParameter('btn_text');
  text = decodeURIComponent(text);
  var $btn = $('<button />', {
    type: 'button',
    text: text,
    class: 'expert-button'
  }).click(goToMonaco);
  return $btn;
}

function insertButton() {
  var magButton = $("div[data-auto='topBarButton magnifier']");
  var btn = createButton();
  btn.insertBefore(magButton);
}

function linkHpBtn() {
  var HpButton = $("body").on("click", "#headerLogoLink, a[href='https://studio.tailorbrands.com/brands']", function(e) {
    e.preventDefault(); 
    var redirectUrl = `https://sitcom.tailorbrands.com/editor/studio_site_list?provider_id=${siteAlias}`
    window.open(redirectUrl, '_blank');
  })
}
  
$(document).ready(function(){
  waitForMonacoBtn();
  linkHpBtn()
});
